  false,\n\t\"url\": null,\n\t\"notes\": \"nDigital line graph (DLG) data are digital
  representations ofncartographic information. DLG's of map features arenconverted
  to digital form from maps and related sources.nIntermediate-scale DLG data are derived
  from USGSn1:100,000-scale 30- by 60-minute quadrangle maps. If thesenmaps are not
  available, Bureau of Land Managementnplanimetric maps at a scale of 1: 100,000 are
  used.nIntermediate-scale DLG's are sold in five categories: (1)nPublic Land Survey
  System; (2) boundaries (3)ntransportation; (4) hydrography; and (5) hypsography.
  AllnDLG data distributed by the USGS are DLG - Level 3 (DLG-3),nwhich means the
  data contain a full range of attributencodes, have full topological structuring,
  and have passedncertain quality-control checks.n\",\n\t\"license_title\": null,\n\t\"extras\":
